import React from 'react'

const UpcCard = () => {
  return (
    <div className='upcCard'>
        <div className='upcDetail'>
            {props.detail}
            <div className='upcTime'>
                {props.time}
            </div>
        </div>

        <div>
            <img className='pin' src={props.img}></img>
            <img className='dot' src='./images/threeDot.png'></img>
        </div>


    </div>
  )
}

export default UpcCard
